import React from "react";

import { Link, useParams } from "react-router-dom";

function Title({ data }) {
  return (
    <div className="container__prez--title">
      <h1>{data}</h1>
    </div>
  );
}

function Model({ data }) {
  const url = useParams();
  console.log(data);
  return (
    <div className="container__prez--model">
      {data.map((item) => {
        return (
          <li className="container__prez--list" key={item.Modeleid}>
            <Link to={`/product/${url._Id}/${item.Modeleid}`}>
              <h2>{item.name}</h2>
            </Link>
            <p>{item.nb_place} Places</p>
          </li>
        );
      })}
    </div>
  );
}
